import React, { useEffect } from 'react';
import './App.css';
import Search from './component/Search';
import {axios} from 'axios';
import {useState} from 'react';
function App() {
  const [data,useData] = useState([]);
  const [per,setper] = useState([]);
  useEffect(()=>{
    if(data!=[] ){
      const information = axios.post('http://127.0.0.1:8000/api/list/',data)
      information.then((response)=>response.data).then(function(result){
        setper(result);
      })
    }
    console.log('per',per);

  },[data]);
  return ( 
    <div>
      <Search  set = {useData}/>
    </div>
  );
}

export default App;
